from copy import deepcopydef read(txt):    f = open(txt, "r")    lines = f.readlines()    i = 0    lin = 0    col = 0    listtemp = []    for line in lines:        if i == 0:            lin = int(line)        elif i == 1:            col = int(line)            templ = [0 for i in range(col)]            for tempi in range(lin):                listtemp.append(templ.copy())        else:            temp = line.split(" ")            for j in range(col-1):                 listtemp[i-2][j] = float(temp[j])            listtemp[i-2][col-1] = float(temp[col-1][:-1])        i += 1    f.close()    return listtempdef read2(txt):    n = 0    res = list()    f = open(txt, "r")    lines = f.readlines()    i = 0    lin = 0    col = 0    listtemp = []    for line in lines:        if i == 0:            n = int(line)        elif i == 1:            lin = int(line)        elif i == 2:            col = int(line)            templ = [0 for i in range(col)].copy()            mat = 1            for tempi in range(lin):                listtemp.append(templ.copy())        else:            if i == (lin+1) * mat +2 :                mat += 1                res.append(deepcopy(listtemp))                #print(listtemp)                if mat == n+1:                    break            else:                temp = line.split(" ")                for j in range(col-1):                     listtemp[(i-3)%(lin+1)][j] = float(temp[j])                listtemp[(i-3)%(lin+1)][col-1] = float(temp[col-1][:-1])            i += 1    f.close()        return res